import React from 'react';
import Slider from 'react-slick';


const settings = {
  dots: true,
  infinite: true,
  speed: 500,
  slidesToShow: 1,
  slidesToScroll: 1,
  autoplay: true,
  autoplaySpeed: 3000,
  arrows: false
};

const banners = [
  { src: 'https://i.stack.imgur.com/Bqbb0.png', alt: 'Banner 1' },
  { src: 'https://t4.ftcdn.net/jpg/05/48/67/71/360_F_548677113_Ag2TKNl74lGzpx3ChMD4STJbm61PdVuY.jpg', alt: 'Banner 2' },
  { src: 'https://i.stack.imgur.com/Bqbb0.png', alt: 'Banner 3' }
];

const BannerSlider = () => {
  return (
    <div style={{ display: 'flex', justifyContent: 'center' }}>
      <Slider {...settings}>
        {banners.map(banner => (
          <div key={banner.src}>
            <img src={banner.src} alt={banner.alt} />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default BannerSlider;
